import React from "react";
import { MDBContainer } from 'mdbreact';

const MostPopularMovies = () => {
  
  return (
    <MDBContainer className="mt-5">
      <h1 className="h1">Most Popular Movies</h1>
    </MDBContainer>
  );
}

export default MostPopularMovies;
